class Solution:
    def maximumValueSum(self, x: List[List[int]]) -> int:

        m,n = len(x), len(x[0])

        t = []
        for i in range(m):
            for j in range(n):
                t.append((x[i][j], i ,j ))
        t.sort(reverse=True)

        collection = []
        for i in range(m*n):
            v,x,y = t[i]
            pos = 0
            for j in range(i+1, m*n):
                tv,tx,ty = t[j]
                if tx != x and ty != y:
                    collection.append((v+tv, x, y, tx, ty))
                    pos += 1
                    if pos == 4: break
        collection.sort(reverse = True)

        res = []
        for i in range(len(collection)):
            v,x,y,tx,ty = collection[i]
            for j in range(m*n):
                thirdRock, thirdx, thirdy = t[j]
                if thirdx != x and thirdx != tx and thirdy != y and thirdy != ty:
                    res.append(v+thirdRock)
                    break
        return max(res)
